import React, { useState } from 'react';
import './App.css';

function Files() {
  return (
    <div className="files_wrapper">
      <div className="item">1</div>
      <div className="item">2</div>
      <div className="item">3</div>
      <div className="item">4</div>
    </div>
  );
}

function LoginForm() {
  const [login, setLogin] = useState('');
  const [password, setPwd] = useState('');
  const [showFiles, setShowFiles] = useState(false); // Состояние для отображения компонента Files
  const [loginError, setLoginError] = useState(false); // Состояние для ошибки логина
  const [passwordError, setPasswordError] = useState(false); // Состояние для ошибки пароля

  const loginConfirm = () => {
    // Проверяем, заполнены ли поля
    if (login === '' || password === '') {
      setLoginError(login === '');
      setPasswordError(password === '');
      return;
    }

    // Сбрасываем ошибки
    setLoginError(false);
    setPasswordError(false);

    // Отправляем данные на сервер
    fetch('login', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        login: login,
        password: password,
      }),
    })
      .then((response) => response.json())
      .then((data) => {
        console.log('Успешный вход:', data);
        setShowFiles(true); // Показываем компонент Files после успешного входа
      })
      .catch((error) => {
        console.error('Ошибка:', error);
      });
  };

  return (
    <div className="login_wrapper">
      <h3>Вход</h3>

      <div className="inputs">
        <div className="input_wrapper">
          <p>Логин: </p>
          <input
            className={`login ${loginError ? 'error' : ''}`}
            placeholder="type login here"
            type="email"
            onChange={(e) => setLogin(e.target.value)}
          />
          {loginError && <p style={{ color: 'red' }}>Поле логина не может быть пустым</p>}
        </div>

        <div className="input_wrapper">
          <p>Пароль: </p>
          <input
            className={`pwd ${passwordError ? 'error' : ''}`}
            placeholder="type password here"
            type="password"
            onChange={(e) => setPwd(e.target.value)}
          />
          {passwordError && <p style={{ color: 'red' }}>Поле пароля не может быть пустым</p>}
        </div>
      </div>

      <button className="submit-btn" onClick={loginConfirm}>
        Войти
      </button>

      {/* Условный рендеринг компонента Files */}
      {showFiles && <Files />}
    </div>
  );
}

function Header() {
  return (
    <div className="header_wrapper">
      <div className="header">
        <div className="item">
          <p>data storage</p>
        </div>

        <div className="item">
          <a href="/about">о проекте</a>
        </div>

        <div className="item">
          <a href="/">profile</a>
        </div>
      </div>
    </div>
  );
}

function App() {
  return (
    <div>
      <Header />
      <div className="main">
        <LoginForm />
      </div>
    </div>
  );
}

export default App;
